-- ----------------------------
-- Table structure for `city`
-- ----------------------------
DROP TABLE IF EXISTS `city`;
CREATE TABLE `city` (
`id`  int(11) NOT NULL AUTO_INCREMENT ,
`name`  char(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '城市名称' ,
`province_id`  int(11) NULL DEFAULT NULL COMMENT '所属省份' ,
`key_title`  char(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '拼音首字符' ,
`status`  int(1) NULL DEFAULT NULL COMMENT '是否有效，1为有效，0为无效' ,
PRIMARY KEY (`id`)
)
ENGINE=MyISAM
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci
COMMENT='城市信息表'
AUTO_INCREMENT=393

;

