-- ----------------------------
-- Table structure for `input_rule`
-- ----------------------------
DROP TABLE IF EXISTS `input_rule`;
CREATE TABLE `input_rule` (
`id`  int(11) NOT NULL AUTO_INCREMENT ,
`province_id`  int(11) NULL DEFAULT NULL COMMENT '车信城市id' ,
`province_name`  char(30) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '省份名称' ,
`province_pinyin`  varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '省份拼音' ,
`province_prefix`  char(2) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '省份前缀' ,
`city_id`  int(11) NULL DEFAULT NULL COMMENT '城市id' ,
`city_pinyin`  varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '城市拼音' ,
`city_name`  char(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '城市名称' ,
`car_no_prefix`  char(2) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '车牌前缀' ,
`car_frame_len`  int(11) NULL DEFAULT '-1' COMMENT '车架号长度' ,
`car_engine_len`  int(11) NULL DEFAULT '-1' COMMENT '发动机号长度' ,
`owner_name_len`  int(10) NULL DEFAULT '-1' COMMENT '车辆拥有者姓名长度' ,
`car_certificate_len`  int(10) NULL DEFAULT '-1' COMMENT '车辆登记证书长度' ,
`update_time`  datetime NULL DEFAULT NULL COMMENT '更新时间' ,
`create_time`  datetime NULL DEFAULT NULL COMMENT '创建时间' ,
PRIMARY KEY (`id`)
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci
COMMENT='输入规则表'
AUTO_INCREMENT=505

;

