-- ----------------------------
-- Table structure for `query_area`
-- ----------------------------
DROP TABLE IF EXISTS `query_area`;
CREATE TABLE `query_area` (
`id`  int(11) NOT NULL AUTO_INCREMENT ,
`org_code`  char(6) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '机构编码' ,
`province_id`  int(11) NOT NULL COMMENT '省份id' ,
`city_id`  int(11) NULL DEFAULT NULL COMMENT '城市id' ,
`province_name`  char(30) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '省份名称' ,
`update_time`  datetime NULL DEFAULT NULL ,
`city_name`  char(30) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '城市名称' ,
`create_time`  datetime NULL DEFAULT NULL COMMENT '创建时间' ,
PRIMARY KEY (`id`)
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci
COMMENT='查询区域表'
AUTO_INCREMENT=15

