-- ----------------------------
-- Table structure for `query_info`
-- ----------------------------
DROP TABLE IF EXISTS `query_info`;
CREATE TABLE `query_info` (
`id`  bigint(20) NOT NULL AUTO_INCREMENT ,
`car_no`  char(7) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '车牌号' ,
`car_frame_no`  char(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '车架号' ,
`car_engine_no`  char(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '发动机号' ,
`car_certificate`  char(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '车辆登记证书' ,
`owner_name`  char(30) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '车主姓名' ,
`car_type`  int(11) NOT NULL COMMENT '车辆类型' ,
`spi_id`  int(11) NULL DEFAULT NULL COMMENT 'spi的id(用于计费)' ,
`from_cache`  tinyint(11) NULL DEFAULT NULL COMMENT '是否从缓存返回' ,
`org_code`  char(6) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '机构编码' ,
`area`  char(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '区域（md5(base64(carNo-provinceId-cityId-errorCode))）' ,
`task_id`  int(11) NULL DEFAULT NULL COMMENT '任务ID' ,
`query_time`  datetime NOT NULL COMMENT '查询时间(接口调用时间)' ,
`cost_time`  int(11) NOT NULL DEFAULT 0 COMMENT '查询耗时(单位毫秒)' ,
`traffic_counts`  int(11) NULL DEFAULT NULL COMMENT '违章记录条数' ,
`error_code`  int(10) NULL DEFAULT NULL COMMENT '错误代号' ,
`error_message`  varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '错误信息' ,
`create_time`  datetime NULL DEFAULT NULL COMMENT '创建时间' ,
`update_time`  datetime NULL DEFAULT NULL COMMENT '更新时间' ,
PRIMARY KEY (`id`)
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci
COMMENT='查询记录表'
AUTO_INCREMENT=288

;

