-- ----------------------------
-- Table structure for `query_task`
-- ----------------------------
DROP TABLE IF EXISTS `query_task`;
CREATE TABLE `query_task` (
`id`  int(11) NOT NULL AUTO_INCREMENT ,
`name`  varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '自定义任务名称' ,
`operator_id`  int(11) NULL DEFAULT NULL COMMENT '操作员' ,
`org_code`  char(6) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '机构编号' ,
`task_detail`  varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '任务描述' ,
`task_type`  int(11) NULL DEFAULT NULL COMMENT '任务类型' ,
`status`  int(11) NULL DEFAULT NULL COMMENT '任务状态' ,
`org_schedule_id`  int(11) NOT NULL COMMENT '机构调度id' ,
`create_time`  datetime NULL DEFAULT NULL COMMENT '创建时间' ,
`update_time`  datetime NULL DEFAULT NULL COMMENT '更新时间' ,
PRIMARY KEY (`id`)
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci
COMMENT='查询任务表'
AUTO_INCREMENT=4

;

