-- ----------------------------
-- Table structure for `task_car`
-- ----------------------------
DROP TABLE IF EXISTS `task_car`;
CREATE TABLE `task_car` (
`id`  bigint(20) NOT NULL AUTO_INCREMENT ,
`query_task_id`  bigint(20) NULL DEFAULT NULL COMMENT '查询任务id' ,
`org_car_id`  bigint(20) NULL DEFAULT NULL COMMENT '机构车辆id' ,
`status`  int(11) NULL DEFAULT NULL COMMENT '状态(0:为查询，1：已经查询)' ,
`create_time`  datetime NULL DEFAULT NULL COMMENT '创建时间' ,
PRIMARY KEY (`id`)
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci
COMMENT='任务车辆信息'
AUTO_INCREMENT=9

;

