-- ----------------------------
-- Table structure for `traffic_info`
-- ----------------------------
DROP TABLE IF EXISTS `traffic_info`;
CREATE TABLE `traffic_info` (
`id`  bigint(20) NOT NULL AUTO_INCREMENT ,
`car_no`  char(7) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '车牌号' ,
`car_type`  int(11) NULL DEFAULT NULL COMMENT '车型' ,
`traffic_detail`  varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '违章描述' ,
`traffic_city`  char(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '违章城市' ,
`traffic_location`  varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '违章地点' ,
`traffic_time`  datetime NULL DEFAULT NULL COMMENT '违章时间' ,
`archive`  varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '文书号' ,
`code`  varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '违章代号' ,
`unique_key`  char(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '唯一标识一条违章记录=md5(base64(carNo+carType+detail+happenTime))' ,
`scores`  int(11) NULL DEFAULT NULL COMMENT '违章扣分' ,
`money`  float NULL DEFAULT NULL COMMENT '违章罚款' ,
`create_time`  datetime NULL DEFAULT NULL COMMENT '创建时间' ,
`status`  int(11) NULL DEFAULT NULL COMMENT '处理状态' ,
PRIMARY KEY (`id`)
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci
COMMENT='违章记录表'
AUTO_INCREMENT=270

;

